sys_variable_value.value:
(function(outputs, steps, stepResult, assertEqual)
{
	var test = new x_snc_devtools.TestAPI(outputs, steps, stepResult, assertEqual);
	
	test.SetResult(true);

	function TestCase_CleanUpDependencyObject(vDependencyObject, vExpected)
	{
		function TestCase_CleanUpDependencyObject_CheckResult(vInput,vExpected,vResult)
		{
			vDependencyObject = vInput['vDependencyObject'];
			if (x_snc_devtools.IsObject(vDependencyObject) == false)
			{
				if (x_snc_devtools.IsValidRecord(vDependencyObject) == false)
				{
					return x_snc_devtools.IsEqual(vDependencyObject,vResult); 
				}
			}
			var aKeys = x_snc_devtools.GetKeys(vResult);
			if (x_snc_devtools.ArrayValueExists(aKeys,'sys_meta') == true)
			{
				return false;
			}
			if (x_snc_devtools.ArrayValueExists(aKeys,'sys_mod_count') == true)
			{
				return false;
			}	
			if (x_snc_devtools.ArrayValueExists(aKeys,'sys_created_on') == true)
			{
				return false;
			}				
			return true;
		}

		test.TestCase(
			'Function CleanUpDependencyObject()',
			CleanUpDependencyObject,
			{
				'vDependencyObject': vDependencyObject
			},
			vExpected,
			TestCase_CleanUpDependencyObject_CheckResult);
	}

	TestCase_CleanUpDependencyObject(null,null);
	TestCase_CleanUpDependencyObject({
		sys_id: x_snc_devtools.GetPseudoSysId(),
		dependency: x_snc_devtools.GetPseudoSysId(),
		reason: 'Why?',
		versions: '2.0.0,1.5.0',
		sys_mod_count: 100
		},null);
	
	TestCase_CleanUpDependencyObject(
		x_snc_devtools.GetRecord('x_snc_devtools_dependency','e27f1a861bcd29505b76777d8b4bcb36'),
		null);
	
	
	return test.GetResult();
	
})(outputs, steps, stepResult, assertEqual);
